//Imports
import React, { useState, useEffect } from "react";
import { useParams, useNavigate } from "react-router";

export default function Edit() {
 const [form, setForm] = useState({
   productDesc: "",
   productExp: "",
   productCat: "",
   stock: [],
 });
 const params = useParams();
 const navigate = useNavigate();

 useEffect(() => {
   async function fetchData() {
     const id = params.id.toString();
     const response = await fetch(`http://localhost:5050/stockDB/${params.id.toString()}`);

     if (!response.ok) {
       const message = `An error has occurred: ${response.statusText}`;
       window.alert(message);
       return;
     }

     const stock = await response.json();
     if (!stock) {
       window.alert(`Stock with id ${id} not found`);
       navigate("/");
       return;
     }

     setForm(stock);
   }

   fetchData();

   return;
 }, [params.id, navigate]);

 // These methods will update the state properties.
 function updateForm(value) {
   return setForm((prev) => {
     return { ...prev, ...value };
   });
 }

 async function onSubmit(e) {
   e.preventDefault();
   const editedPerson = {
     productDesc: form.productDesc,
     productExp: form.productExp,
     productCat: form.productCat,
   };

   // This will send a post request to update the data in the database.
   await fetch(`http://localhost:5050/stockDB/${params.id}`, {
     method: "PATCH",
     body: JSON.stringify(editedPerson),
     headers: {
       'Content-Type': 'application/json'
     },
   });

   navigate("/");
 }

 // This following section will display the form that takes input from the user to update the data.
 return (
   <div className="crudCreateStyle">
     <h3>Update Item</h3>
     <form onSubmit={onSubmit} className="formStyle">
       <div className="form-group">
         <label htmlFor="productDesc">Product: </label>
         <input
           type="text"
           className="form-control"
           id="productDesc"
           value={form.productDesc}
           onChange={(e) => updateForm({ productDesc: e.target.value })}
         />
       </div>
       <div className="form-group">
         <label htmlFor="productExp">Expiry: </label>
         <input
           type="text"
           className="form-control"
           id="productExp"
           value={form.productExp}
           onChange={(e) => updateForm({ productExp: e.target.value })}
         />
       </div>
       <div className="form-group">
         <div className="form-check form-check-inline">
           <input
             className="form-check-input"
             type="radio"
             name="categoryOptions"
             id="categoryDairy"
             value="Dairy"
             checked={form.productCat === "Dairy"}
             onChange={(e) => updateForm({ productCat: e.target.value })}
           />
           <label htmlFor="categoryDairy" className="form-check-label">Dairy</label>
         </div>
         <div className="form-check form-check-inline">
           <input
             className="form-check-input"
             type="radio"
             name="categoryOptions"
             id="categoryMeat"
             value="Meat"
             checked={form.productCat === "Meat"}
             onChange={(e) => updateForm({ productCat: e.target.value })}
           />
           <label htmlFor="categoryMeat" className="form-check-label">Meat</label>
         </div>
         <div className="form-check form-check-inline">
           <input
             className="form-check-input"
             type="radio"
             name="categoryOptions"
             id="categoryVeg"
             value="Veg"
             checked={form.productCat === "Veg"}
             onChange={(e) => updateForm({ productCat: e.target.value })}
           />
           <label htmlFor="categoryVeg" className="form-check-label">Veg</label>
         </div>
       </div>
       <br />

       <div className="form-group">
         <input
           type="submit"
           value="Update"
           className="btn btn-primary"
         />
       </div>
     </form>
   </div>
 );
}
